$(window).on("load",function(){var a=$(".size-img");a.each(function(){var c=Math.round($(this).find("img").height());var b=Math.round($(this).find("img").width());$(this).prepend('<div class="element-size">'+c+" x "+b+"</div>")})});$(window).on("resize",function(){var a=$(".size-img");a.each(function(){var c=Math.round($(this).find("img").height());var b=Math.round($(this).find("img").width());$(this).find(".element-size").text(c+" x "+b)})});
